import React from 'react';
import { connect } from 'react-redux';
import * as FlexWebChat from '@twilio/flex-webchat-ui';

const wrapper = {
  display: 'block',
  overflowX: 'hidden',
  justifyContent: 'center',
  width: '40%',
};

const bubble = {
  paddingLeft: '12px',
  paddingRight: '12px',
  color: 'black',
  paddingTop: '5px',
  paddingBottom: '8px',
  margin: '5px 10px',
  position: 'relative',
  overflowX: 'hidden',
  display: 'flex',
  background: '#eeeeee',
  borderRadius: '6px',
  fontSize: '1em',
};

const ClickableMessages = () => {
  return <div>Hu</div>;
};

const mapStateToProps = (state) => {
  let channelSid = state.flex.session.channelSid;

  return {
    state: state,
    clickableMessages: state.custom.clickableMessages,
    channelSid,
  };
};

export default connect(mapStateToProps)(ClickableMessages);
